import React, { useEffect } from 'react';
// import { Link } from "react-router-dom";
import { useDispatch, useSelector } from 'react-redux';
import { getDetailPokemon } from '../store/actions';


export default function DetailPokemon(props){
    let pokemonId = props.match.params.id
    const detailPokemon = useSelector((state)=> state.pokemonDetail);  
    let dispatch = useDispatch();
    useEffect(() =>{
        dispatch(getDetailPokemon(pokemonId))
    }, []);
    console.log(detailPokemon)
    return(
        <div>
           <h4>Detalle de pokemon</h4>
        </div>
    )
}
